import styled from 'styled-components'

const Outer = styled.div`
    width: 60%;
    margin: auto;

    ul{
        text-align: left;
        padding-left: 1%;
        padding-right: 1%;
        list-style-type: square;
        list-style-position: inside;
    }

    li{
        font-size: 17px;
        font-weight: 400;
    }
`

export default Outer
